comments.body:
The problem is with case sensitive file systems. Appcelerator 5.0.0.GA puts the build of the app in 'build/iphone/Build', but the xcodeproject is created in 'build/iphone/build' (see the capital letter in the second build). The first time this is noticed is when xcode is finding the Info.plist file. 
One solution is to put the xcodeproject also in 'build/iphone/Build'. This can be done by changing line 2075 in the file: 5.0.0.GA/iphone/cli/commands/_build.js
{{this.iosBuildDir            = path.join(this.buildDir, 'build', 'Products', this.xcodeTarget + '-' + (this.target === 'simulator' ? 'iphonesimulator' : 'iphoneos'));}}
to
{{this.iosBuildDir            = path.join(this.buildDir, 'Build', 'Products', this.xcodeTarget + '-' + (this.target === 'simulator' ? 'iphonesimulator' : 'iphoneos'));}}

Then your project can run on IOS9 simulator.
